issement dans ces derniers. L\\u2019ensemble des programmes dispens\\u00e9s au sein de l\\u2019Ecole du Code, du Fablab Solidaire, de l\\u2019Orange Fab et de l\\u2019Orange Digital Ventures Africa sont gratuits.\",\"link\":\"#Acceuil\",\"text2\":\"\",\"image_url\":\"http:\\/\\/localhost\\/ODC\\/wp-content\\/uploads\\/2022\\/07\\/Orange-telecom-300x200.jpg\",\"title\":\"ODC-MALI\",\"subtitle\":\"Orange Digital Center\",\"slide_align\":\"left\",\"social_repeater\":\"undefined\",\"id\":\"customizer_repeater_slider_001\",\"shortcode\":\"undefined\"},{\"text\":\"Orange Digital Kalanso est la premi\\u00e8re \\u00e9cole de formation aux m\\u00e9tiers du num\\u00e9rique libre d\\u2019acc\\u00e8s et totalement gratuite pour les jeunes de 18 \\u00e0 30 ans.\",\"link\":\"#Acceuil\",\"text2\":\"\",\"image_url\":\"http:\\/\\/localhost\\/ODC\\/wp-content\\/uploads\\/2022\\/07\\/pexels-christina-morillo-1181639-300x200.jpg\",\"title\":\"OD-KALANSO\",\"subtitle\":\"Orange Digital Kalanso\",\"slide_align\":\"right\",\"social_repeater\":\"undefined\",\"id\":\"customizer_repeater_slider_002\",\"shortcode\":\"undefined\"},{\"text\":\" Orange Fab vous r\\u00e9fl\\u00e9chissez \\u00e0 comment passer votre start-up au niveau sup\\u00e9rieur ? Orange Digital Center Mali vous propose une solution ! Orange Fab est un acc\\u00e9l\\u00e9rateur de start-up qui accompagne les jeunes pousses et leur permet de se d\\u00e9velopper sur le plan commercial avec \\u00e0 la cl\\u00e9s des partenariats nationaux et internationaux.\",\"link\":\"#Acceuil\",\"text2\":\"\",\"image_url\":\"http:\\/\\/localhost\\/ODC\\/wp-content\\/uploads\\/2022\\/07\\/281840093_309492201355565_7064107839562377432_n-1-300x225.jpg\",\"title\":\"Un acc\\u00e9l\\u00e9rateur de startups\",\"subtitle\":\"Orange Fab\",\"slide_align\":\"right\",\"social_repeater\":\"undefined\",\"id\":\"customizer_repeater_slider_003\",\"shortcode\":\"undefined\"},{\"text\":\"Le FabLab est un lieu de formation o\\u00f9 les b\\u00e9n\\u00e9ficiaires peuvent \\u00e9changer sur des sujets pr\\u00e9cis en s\\u2019appuyant sur les principes suivants :entraide et partage ; apprendre \\u00e0 faire soi-m\\u00eame ; rangement et nettoyage ; respect des r\\u00e8gles de s\\u00e9curit\\u00e9 ; respect du mat\\u00e9riel.\",\"link\":\"\",\"text2\":\"\",\"image_url\":\"http:\\/\\/localhost\\/ODC\\/wp-content\\/uploads\\/2022\\/07\\/image00002-300x223.jpeg\",\"title\":\"Un FabLab Solidaire \",\"subtitle\":\"FabLab \",\"slide_align\":\"left\",\"social_repeater\":\"undefined\",\"id\":\"customizer-repeater-62e02f40fc9ae\",\"shortcode\":\"undefined\"}]\";s:14:\"slider_opacity\";s:3:\"0.5\";s:11:\"nav_btn_lbl\";s:0:\"\";s:16:\"background_image\";s:99:\"http://localhost/ODC/wp-content/uploads/2022/07/272909633_240736371564482_7688473245408455440_n.jpg\";s:12:\"nav_btn_link\";s:0:\"\";s:17:\"background_preset\";s:4:\"fill\";s:21:\"background_position_x\";s:4:\"left\";s:21:\"background_position_y\";s:3:\"top\";s:15:\"background_size\";s:5:\"cover\";s:17:\"background_repeat\";s:9:\"no-repeat\";s:21:\"background_attachment\";s:5:\"fixed\";s:13:\"hs_breadcrumb\";b:1;s:7:\"hs_blog\";b:1;s:7:\"hs_info\";b:1;s:13:\"feature_title\";s:21:\"ORANGE DIGITAL CENTER\";s:16:\"feature_subtitle\";s:188:\"Nos entités <span class=\"av-heading animate-7\"><span class=\"av-text-wrapper\"><b class=\"is-show\">Features</b>                                   <b>Features</b><b>Features</b></span></span>\";s:6:\"hs_cta\";b:0;s:10:\"hs_feature\";b:0;s:10:\"hs_service\";b:0;s:23:\"info_first_icon_setting\";s:7:\"fa-code\";s:10:\"info_title\";s:22:\"Orange Digital Kalanso\";s:16:\"info_description\";s:133:\"est une école du code, centre à vocation technologique qui propose des formations sur les métiers du numérique et des animations.\";s:11:\"info_title2\";s:10:\"Orange FAB\";s:17:\"info_description2\";s:186:\"est un accélérateur de start-up qui accompagne les jeunes pousses et leur permet de se développer sur le plan commercial avec à la clés des partenariats