(148, 1, '2022-07-26 21:09:31', '2022-07-26 19:09:31', '.header-above-info {\n    color: var(--sp-white);\n    background-color: #242424;\n    padding-bottom: 0px;\n    margin: -51px;\n} \n/* couleur du haut de page*/\n\n.logo img, .mobile-logo img {\n    max-width: 70px;\n    margin-left: -53px;\n    padding: 0px;\n    padding-top: 50px;\n    padding-bottom: 0px;\n}\n/* image espace*/\n.menubar .menu-wrap > li > a {\n    padding: 0px 16px;\n    display: inline-flex;\n    color: #ffffff;\n}\n/* couleur du text d\'en tête*/\n.menubar .menu-wrap > li > a {\n    padding: 0px 16px;\n    display: inline-flex;\n    color: #ffffff;\n}\n/*l\'en tête */\n.navbar-area {\n    padding: 0px;\n    background: black;\n}\n/*Ecriture accueil*/\n.primary-color, .av-link {\n    color: #ff7900;\n}\n/*Button de defillement*/\n.owl-theme div.owl-nav [class*=owl-] {\n    width: 25px;\n    height: 25px;\n    font-size: 0.75rem;\n    line-height: 1.4;\n    display: inline-block;\n    cursor: pointer;\n    text-align: center;\n    color: var(--sp-white);\n    background-color: #ff7900;\n    border: 1px solid #ff7900;\n    border-radius: 100%;\n}\n/*Carre au millieu*/\n.info-wrapper .info-third .widget {\n    background-color: #242424;\n}\n\n.info-wrapper .info-second .widget {\n    background-color: #ff7900;\n}\n\n.info-wrapper .widget {\n    padding: 28px 55px;\n    position: relative;\n    border-radius: 0;\n    overflow: hidden;\n    display: block;\n    color: var(--sp-white);\n    background-color: #ff7900;\n    height: 100%;\n    z-index: 0;\n}\nbutton[type=submit], button, input[type=\"button\"], input[type=\"reset\"], input[type=\"submit\"], .av-btn-primary, .navigation.posts-navigation .nav-links a {\n    color: var(--sp-white);\n    background-color: #ff7900;\n    border-color: #ff7900;\n}\n.info-wrapper .info-second .widget:before, .info-wrapper .info-first .widget, .info-wrapper .info-third .widget {\n    background-color: #242424;\n}\n.fadeInUp {\n    animation-name: fadeInUp;\n		color: #FFFFFF;\n}\n\n/*root*/\n:root {\n    --sp-green: #ffffff;\n    --sp-white: #ffffff;\n    --sp-primary: #FF7900;\n    --sp-primary-dark: #FF7900;\n    --sp-primary-light: #fef8f8;\n    --sp-secondary: #151635;\n    --sp-secondary-dark: #242424;\n    --sp-border-dark: #dddddd;\n    --sp-border-light: #e9e9e9;\n    --sp-border-extra-light: #f2f2f2;\n    --sp-scrollbar-thumb: #c2c2c2;\n    --sp-font-sans-serif: \"Fira Sans\",system-ui,-apple-system,\"Segoe UI\",Roboto,\"Helvetica Neue\",Arial,\"Noto Sans\",sans-serif,\"Apple Color Emoji\",\"Segoe UI Emoji\",\"Segoe UI Symbol\",\"Noto Color Emoji\";\n    --sp-font-monospace: SFMono-Regular,Menlo,Monaco,Consolas, \"Liberation Mono\",\"Courier New\",monospace;\n    --sp-gradient: linear-gradient(180deg,rgba(255,255,255,0.15),rgba(255,255,255,0));\n    /* --sp-gradient-focus: linear-gradient(#d61523, #d61523), linear-gradient(#e9e9ea, #e9e9ea); */\n    --sp-shadow: 2px 5px 20px rgba(0, 0, 0, .2);\n    --sp-radius: 3px;\n    --sp-transition: all .3s cubic-bezier(.645,.045,.355,1);\n}\n\n.footer-dark {\n    color: var(--sp-white);\n    background-color: #242424;\n}\n.header-above-info .header-widget {\n    /* height: 100%; */\n    /* display: -webkit-box; */\n    display: -moz-box;\n    display: -ms-flexbox;\n    /* display: -webkit-flex; */\n    /* display: flex; */\n    /* -webkit-box-align: center; */\n    -ms-flex-align: center;\n    /* align-items: center; */\n    /* margin: 9px; */\n    margin-top: 26px;\n    /* margin-block-end: auto; */\n}\n.footer-dark {\n    color: var(--sp-white);\n    background-color: #242424;\n    padding: 30px;\n}\n\n\n\n\n\n\n\n\n\n\n', 'avril', '', 'publish', 'closed', 'closed', '', 'avril', '', '', '2022-07-27 00:09:32', '2022-07-26 22:09:32', '', 0, 'http://localhost/ODC/2022/07/26/avril/', 0, 'custom_css', '', 0),
