(217, 1, '2022-07-27 02:42:02', '2022-07-27 00:42:02', '{\n    \"avril::slider\": {\n        \"value\": \"[{\\\"text\\\":\\\"Le principe de Orange Digital Center est de r\\u00e9unir dans un m\\u00eame espace plusieurs programmes strat\\u00e9giques, allant de la formation des jeunes aux m\\u00e9tiers du num\\u00e9rique jusqu\\u2019\\u00e0 l\\u2019acc\\u00e9l\\u00e9ration de start-up en passant par l\\u2019accompagnement de porteurs de projets et l\\u2019investissement dans ces derniers. L\\u2019ensemble des programmes dispens\\u00e9s au sein de l\\u2019Ecole du Code, du Fablab Solidaire, de l\\u2019Orange Fab et de l\\u2019Orange Digital Ventures Africa sont gratuits.\\\",\\\"link\\\":\\\"#Acceuil\\\",\\\"text2\\\":\\\"Get Started\\\",\\\"image_url\\\":\\\"http://localhost/ODC/wp-content/uploads/2022/07/Orange-telecom-300x200.jpg\\\",\\\"title\\\":\\\"ODC-MALI\\\",\\\"subtitle\\\":\\\"Orange Digital Center\\\",\\\"slide_align\\\":\\\"left\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer_repeater_slider_001\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"text\\\":\\\"Orange Digital Kalanso est la premi\\u00e8re \\u00e9cole de formation aux m\\u00e9tiers du num\\u00e9rique libre d\\u2019acc\\u00e8s et totalement gratuite pour les jeunes de 18 \\u00e0 30 ans.\\\",\\\"link\\\":\\\"#Acceuil\\\",\\\"text2\\\":\\\"Acceuil\\\",\\\"image_url\\\":\\\"http://localhost/ODC/wp-content/uploads/2022/07/pexels-christina-morillo-1181639-300x200.jpg\\\",\\\"title\\\":\\\"OD-KALANSO\\\",\\\"subtitle\\\":\\\"Orange Digital Kalanso\\\",\\\"slide_align\\\":\\\"right\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer_repeater_slider_002\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"text\\\":\\\" Orange Fab vous r\\u00e9fl\\u00e9chissez \\u00e0 comment passer votre start-up au niveau sup\\u00e9rieur ? Orange Digital Center Mali vous propose une solution ! Orange Fab est un acc\\u00e9l\\u00e9rateur de start-up qui accompagne les jeunes pousses et leur permet de se d\\u00e9velopper sur le plan commercial avec \\u00e0 la cl\\u00e9s des partenariats nationaux et internationaux.\\\",\\\"link\\\":\\\"#Acceuil\\\",\\\"text2\\\":\\\"\\\",\\\"image_url\\\":\\\"http://localhost/ODC/wp-content/uploads/2022/07/IMG_4359-300x225.jpg\\\",\\\"title\\\":\\\"Un acc\\u00e9l\\u00e9rateur de startups\\\",\\\"subtitle\\\":\\\"Orange Fab\\\",\\\"slide_align\\\":\\\"right\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer_repeater_slider_003\\\",\\\"shortcode\\\":\\\"undefined\\\"},{\\\"text\\\":\\\"Le FabLab est un lieu de formation o\\u00f9 les b\\u00e9n\\u00e9ficiaires peuvent \\u00e9changer sur des sujets pr\\u00e9cis en s\\u2019appuyant sur les principes suivants :entraide et partage ; apprendre \\u00e0 faire soi-m\\u00eame ; rangement et nettoyage ; respect des r\\u00e8gles de s\\u00e9curit\\u00e9 ; respect du mat\\u00e9riel.\\\",\\\"link\\\":\\\"\\\",\\\"text2\\\":\\\"\\\",\\\"image_url\\\":\\\"http://localhost/ODC/wp-content/uploads/2022/07/image00002-300x223.jpeg\\\",\\\"title\\\":\\\"Un FabLab Solidaire \\\",\\\"subtitle\\\":\\\"FabLab \\\",\\\"slide_align\\\":\\\"left\\\",\\\"social_repeater\\\":\\\"undefined\\\",\\\"id\\\":\\\"customizer-repeater-62e02f40fc9ae\\\",\\\"shortcode\\\":\\\"undefined\\\"}]\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-07-26 23:46:39\"\n    },\n    \"avril::slider_opacity\": {\n        \"value\": \"0.5\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-07-26 23:44:39\"\n    }\n}', '', '', 'trash', 'closed', 'closed', '', 'bb2d0741-48e2-473a-86dd-9fb5e048f787', '', '', '2022-07-27 02:42:02', '2022-07-27 00:42:02', '', 0, 'http://localhost/ODC/?p=217', 0, 'customize_changeset', '', 0),
